insert into `cms10_f_posts` values('1','Welcome to the forums','This is the inbuilt forum system (known as Conversr).\n\nA forum system is a tool for communication between members; it consists of posts, organised into topics: each topic is a line of conversation.\n\nThe website software provides support for a number of different forum systems, and each forum handles authentication of members: Conversr is the built-in forum, which provides seamless integration between the main website, the forums, and the inbuilt member accounts system.','127.0.0.1','1449676812','1',null,'System','1','1','7',null,null,'0','0',null,'return unserialize(\"a:5:{i:0;a:1:{i:0;a:1:{i:0;a:5:{i:0;s:39:\\\"string_attach_5668500c11f6a0.48532654_1\\\";i:1;a:0:{}i:2;i:1;i:3;s:0:\\\"\\\";i:4;s:0:\\\"\\\";}}}i:1;a:0:{}i:2;s:7:\\\"(mixed)\\\";i:3;N;i:4;a:1:{s:39:\\\"string_attach_5668500c11f6a0.48532654_1\\\";s:627:\\\"\\$tpl_funcs[\'string_attach_5668500c11f6a0.48532654_1\']=\\\"echo \\\\\\\"This is the inbuilt forum system (known as Conversr).\\\\\\\"; echo \\\\\\\"<br />\\\\\\\"; echo \\\\\\\"<br />\\\\\\\"; echo \\\\\\\"A forum system is a tool for communication between members; it consists of posts, organised into topics: each topic is a line of conversation.\\\\\\\"; echo \\\\\\\"<br />\\\\\\\"; echo \\\\\\\"<br />\\\\\\\"; echo \\\\\\\"The website software provides support for a number of different forum systems, and each forum handles authentication of members: Conversr is the built-in forum, which provides seamless integration between the main website, the forums, and the inbuilt member accounts system.\\\\\\\";\\\";\\n\\\";}}\");\n','1');
