  `m_dob_day` tinyint(4) DEFAULT NULL,
  `m_dob_month` tinyint(4) DEFAULT NULL,
  `m_dob_year` int(11) DEFAULT NULL,
  `m_reveal_age` tinyint(1) NOT NULL,
