  `m_signature__source_user` int(11) NOT NULL DEFAULT '1',
  `m_pt_rules_text__text_parsed` longtext NOT NULL,
  `m_pt_rules_text__source_user` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `user_list` (`m_username`),
  KEY `menail` (`m_email_address`(250)),
  KEY `external_auth_lookup` (`m_pass_hash_salted`(250)),
  KEY `sort_post_count` (`m_cache_num_posts`),
  KEY `m_join_time` (`m_join_time`),
  KEY `whos_validated` (`m_validated`),
  KEY `birthdays` (`m_dob_day`,`m_dob_month`),
  KEY `ftjoin_msig` (`m_signature`(250)),
  KEY `primary_group` (`m_primary_group`),
  KEY `avatar_url` (`m_avatar_url`(250)),
  KEY `last_visit_time` (`m_dob_month`,`m_dob_day`,`m_last_visit_time`),
  FULLTEXT KEY `m_signature` (`m_signature`),
  FULLTEXT KEY `m_pt_rules_text` (`m_pt_rules_text`),
  FULLTEXT KEY `search_user` (`m_username`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4;


